import React from 'react'

const Home = (props: any) => {
  return (
    <div id="home-page" className="justify-center bg-red-500 h-screen w-full">
      <div id="search-section" className="bg-[url('/path/to/image.jpg')] bg-opacity-50 bg-cover flex w-full items-center justify-center">
        <img className="z-10" src={require("../../res/home-bg.jpeg")} alt="" />
        <input className="z-20 w-9/12 sm:w-1/2 h-12 rounded-xl text-xl" type="text"/>
      </div>
    </div>
  )
}

export default Home;
